import React, { useState, useRef } from "react";
import { StyleSheet, View, TouchableOpacity, Text } from "react-native";
import FieldInputWithLabel from "./FieldInputWithLabel";
import {
  CardCvcElement,
  CardExpiryElement,
  CardNumberElement,
  useElements,
  useStripe,
} from "@stripe/react-stripe-js";
import styled from "styled-components";

function CheckOutDetails({
  storeDetails,
  setorderDetails,
  orderDetails,
  setpage,
}) {
  const [emailAddress, setEmailAddress] = useState("");

  const stripe = useStripe();
  const elements = useElements();
  const currency = "cad";

  const handleSubmit = async (event) => {
    event.preventDefault();

    if (!stripe || !elements) {
      console.log("Stripe.js has not yet loaded.");
      return;
    }

    const cardNumberElement = elements.getElement(CardNumberElement);
    const newOrderDetails = {
      ...orderDetails,
      customer: { ...orderDetails.customer, email: emailAddress },
    };

    try {
      const { token, error } = await stripe.createToken(cardNumberElement);

      if (error) {
        console.error("Error creating token:", error);
        alert("Error please try again");
        return;
      }

      console.log("Token:", token);

      console.log("token ", token.id);
      console.log("amount ", orderDetails.total);
      console.log("storeUID ", storeDetails.docID);
      console.log("orderDetails ", orderDetails);
      console.log("newOrderDetails ", newOrderDetails);

      const response = await fetch(
        "https://us-central1-posmate-5fc0a.cloudfunctions.net/processPayment",
        {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            token: token.id,
            amount: orderDetails.total,
            currency,
            storeUID: storeDetails.docID,
            orderDetails: newOrderDetails,
          }),
        }
      );

      if (response.ok) {
        const contentType = response.headers.get("content-type");
        if (contentType && contentType.indexOf("application/json") !== -1) {
          const responseData = await response.json();
          if (responseData.success) {
            console.log("Payment processed successfully!");
            setpage(4);
          } else {
            console.error(
              "Payment processing failed. Server message:",
              responseData.message
            );
            alert("Payment processing failed.");
          }
        } else {
          console.error("Non-JSON response received:", await response.text());
          alert("Non-JSON response received.");
        }
      } else {
        throw new Error("Network response was not ok.");
      }
    } catch (jsonError) {
      console.error("Error parsing JSON response or network error:", jsonError);
      alert("Payment processing failed. Please try again.");
    }
  };

  const CARD_ELEMENT_OPTIONS = {
    style: {
      base: {
        iconColor: "#c4f0ff",
        color: "#121212",
        fontWeight: "500",
        fontFamily: "Roboto, Open Sans, Segoe UI, sans-serif",
        fontSize: "16px",
        fontSmoothing: "antialiased",
        ":-webkit-autofill": {
          color: "#121212",
        },
        "::placeholder": {
          color: "#c3c3c3",
        },
        backgroundColor: "transparent", // This assumes your overall background is the color you want
      },
      invalid: {
        iconColor: "#FF0000",
        color: "#FF0000",
      },
    },
    hidePostalCode: true,
  };

  return (
    <>
      <View style={styles.fieldsGroup}>
        <FieldInputWithLabel
          label="Email Address*"
          txtInput="Email Address"
          style={styles.nameField}
          value={emailAddress}
          onChangeText={(text) => setEmailAddress(text)}
          customInput={null} // Should be a standard TextInput if needed
        />
        <FieldInputWithLabel
          label="Card Number*"
          style={styles.nameField}
          customInput={() => (
            <div
              style={{
                backgroundColor: "#f4f4f4",
                borderRadius: 4,
                justifyContent: "center",
                alignItems: "center",
                padding: 14,
              }}
            >
              <CardNumberElement options={CARD_ELEMENT_OPTIONS} />
            </div>
          )}
        />
        <View style={styles.buzzCodeAndPhoneRow}>
          <FieldInputWithLabel
            label="Expiry*"
            style={styles.buzzCodeField}
            customInput={() => (
              <div
                style={{
                  backgroundColor: "#f4f4f4",
                  borderRadius: 4,
                  justifyContent: "center",
                  alignItems: "center",
                  padding: 14,
                }}
              >
                <CardExpiryElement options={CARD_ELEMENT_OPTIONS} />
              </div>
            )}
          />
          <FieldInputWithLabel
            label="CVV*"
            style={styles.phoneNumberField}
            customInput={() => (
              <div
                style={{
                  backgroundColor: "#f4f4f4",
                  borderRadius: 4,
                  justifyContent: "center",
                  alignItems: "center",
                  padding: 14,
                }}
              >
                <CardCvcElement options={CARD_ELEMENT_OPTIONS} />
              </div>
            )}
          />
        </View>
      </View>
      <TouchableOpacity
        style={styles.continueBtn}
        onPress={handleSubmit}
        disabled={!stripe}
      >
        <Text style={styles.continueBtnTxt}>CHECKOUT</Text>
      </TouchableOpacity>
    </>
  );
}

const styles = StyleSheet.create({
  container: {
    width: 380,
    height: 390,
  },
  fieldsGroup: {
    width: 380,
    height: 325,
    justifyContent: "space-between",
  },
  nameField: {
    height: 70,
    width: 380,
  },
  addressField: {
    height: 70,
    width: 380,
  },
  buzzCodeAndPhoneRow: {
    width: 380,
    height: 70,
    flexDirection: "row",
    justifyContent: "space-between",
  },
  buzzCodeField: {
    height: 70,
    width: 175,
  },
  phoneNumberField: {
    height: 70,
    width: 175,
  },
  continueBtn: {
    width: 219,
    height: 60,
    backgroundColor: "rgba(238,125,67,1)",
    borderRadius: 60,
    justifyContent: "center",
    alignItems: "center",
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 30,
    shadowOpacity: 0.2,
    shadowRadius: 10,
  },
  continueBtnTxt: {
    color: "rgba(255,255,255,1)",
    fontSize: 18,
    fontWeight: "700",
  },
});

export default CheckOutDetails;
